import React from 'react';
import './footer.scss';

class Footer extends React.Component{

    render() {
        return(
            // i had another code challenge and this project is done in two days, im not exaggerating :)
            <section className="footer">
                <span>I did not do the project in react before, but made with love and deep search in <b>"two"</b> days, hope to enjoy :)</span>
            </section>
        )
    }
}


export default Footer;
